import React, { Component } from "react";
import "./login.css";

class Card extends Component {
  render() {
    return (
      <div class="card" style={{ width: "18rem" }}>
        <dic class="contents">
          <img class="card-img-top" src="..." alt="Card image cap" />
        </dic>
        <div class="card-body">
          <h5 class="card-title">영상 제목</h5>
          <p class="card-text">짧은 설명</p>
        </div>
      </div>
    );
  }
}

export default Card;
